import QuoteList from "../components/quotes/QuoteList";
let dummy_data = [
  { id: "p1", author: "murakami", text: "always be yourself" },
  { id: "p2", author: "remark", text: "love" },
];
let AllQuotes = () => {
  return (
    <div>
      <button classNmae="btn--flat">Sort </button>
      <QuoteList quotes={dummy_data} />
    </div>
  );
};
export default AllQuotes;
